    true,nt"url": null,nt"notes": "<p>1999-2011. The GYTS is a school-based
    survey that collects data on students aged 13u00e2u0080u009315 years using a standardized
    methodology for constructing the sample frame, selecting schools and classes, and
    processing data. The GYTS surveillance system is intended to enhance the capacity
    of countries to design, implement, and evaluate tobacco control and prevention programs.
    Funding for the GYTS has been provided by the Canadian Public Health Association,
    National Cancer Institute, United Nations Children Emergency Fund, and the World
    Health Organizationu00e2u0080u0094Tobacco Free Initiative.</p>n",nt"license_title":
